import React from 'react';
import {Link} from 'react-router-dom'
import {navList} from '../../data/data'



const Header = () => {

    console.log(navList)

    return(
        <div>
            <div className="navBar">
                {
                navList.map((x)=>{
                <Link key={x.id} to={x.link}>{x.name}</Link>})
                }
            </div>
        </div>
    )
}

export default Header
